      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN ( - - 37 ) AND + CAST ( - + CAST ( NULL AS REAL ) AS REAL ) / - + 8 + - - col2;
  - name: tab2

outputs:
  - name: q6010.out
    data: |
